import React from 'react';
import { Card, CardContent, Typography, Grid } from '@material-ui/core';
import styles from './Cards.module.css';
const Cards = ({data:{ confirmed,recovered,death,lastUpdate}}) => {
    if(!confirmed)
    {
        return 'Loading .....';
    }
    return (
        <div className={styles.container}>
            <Grid container spacing={3} justify="center">
                <Grid item component={Card}>
                    <CardContent>
                        <Typography color="textSecondary" gutterBottom>Infected</Typography>
                        <Typography variant="h5">Real Data</Typography>
                        <Typography color="textSecondary" gutterBottom>Infected</Typography>
                        <Typography variant="body2">Number if active cases of COVID-19</Typography>
                    </CardContent>
                </Grid>
                <Grid item component={Card}>
                    <CardContent>
                        <Typography color="textSecondary" gutterBottom>recovered</Typography>
                        <Typography variant="h5">Real Data</Typography>
                        <Typography color="textSecondary" gutterBottom>Infected</Typography>
                        <Typography variant="body2">Number of recoverd cases of COVID-19</Typography>
                    </CardContent>
                </Grid>
                <Grid item component={Card}>
                    <CardContent>
                        <Typography color="textSecondary" gutterBottom>Death</Typography>
                        <Typography variant="h5">Real Data</Typography>
                        <Typography color="textSecondary" gutterBottom>Infected</Typography>
                        <Typography variant="body2">Number of death cases due to COVID-19</Typography>
                    </CardContent>
                </Grid>
            </Grid>
        </div>
    )
}

export default Cards;
